export default function Photos() {
  return (
    <Container style={{ marginLeft: "10%" }}>
    <div>
      <h3>Upload Photos</h3>
      <input type="file" />
      <textarea placeholder="Write description here"></textarea>
      <button>Upload</button>
    </div>
    </Container>
  );
}
